import Typewritter from "./components/Typewritter";

function App() {
  return (
    <div className="App grid grid-cols-1 gap-0 xl:grid-cols-3 w-2/3  m-auto">
      <div className="col-span-2 self-center text-center xl:text-left order-last xl:order-first">
        <h1 className="text-7xl md:text-8xl xl:text-9xl font-light pb-12">
          <Typewritter />
          &nbsp;
        </h1>

        <p className="font-light p-3 border-l-2 border-blue-500">
          Hello, my name is Bartłomiej Mojek. I’m a final-year Computer Science
          student and web developer specializing in responsive web applications
          and React Native apps. I love creating user-friendly solutions with
          HTML, CSS, JavaScript, and frameworks such as React and Node.js.
        </p>
        <p className="font-light p-3 border-l-2 border-blue-500">
          Check out my projects and feel free to get in touch!
        </p>
      </div>

      <div className="col-span-1 self-center text-2xl grid">
        <img src="/website.png" alt="Screenshot of my portfolio website" />
      </div>
    </div>
  );
}

export default App;
